import UserCss from '../../../public/assets/user.css';

  const User = ({children}) =>  {
	return (
	  <div>
        <header>
        <ul>
            <li><a class="active" href="#">Home</a></li>
            <li><a href="#">News</a></li>
            <li><a href="#">Contact</a></li>
